import '../css/Header.css';

class Header {
    render () {
        return (
            <>
                <span class="about-details-span">ABOUT ME</span>
                <div class="hr m-3"></div>
                <p class="mt-3 px-5">Here you will discover further details about me, what I do, and my coding and technology skills.</p>
            </>    
        );
    }
}

export default Header;
